use std::collections::{HashMap, HashSet, VecDeque};

impl Solution {
    pub fn can_traverse_all_pairs(nums: Vec<i32>) -> bool {
        let mut graph = HashMap::new();
        let n = nums.len();
        let mut components = vec![0; n];
        let mut next_component = 1;

        for i in 0..n {
            for j in i + 1..n {
                if gcd(nums[i], nums[j]) > 1 {
                    graph.entry(i).or_insert_with(Vec::new).push(j);
                    graph.entry(j).or_insert_with(Vec::new).push(i);
                }
            }
        }

        for i in 0..n {
            if components[i] == 0 {
                bfs(i, &graph, &mut components, next_component);
                next_component += 1;
            }
        }

        let mut component_count = HashMap::new();
        for &component in &components {
            *component_count.entry(component).or_insert(0) += 1;
        }

        component_count.len() == 1 && *component_count.values().next().unwrap() == n
    }
}

fn gcd(mut a: i32, mut b: i32) -> i32 {
    while b != 0 {
        let t = b;
        b = a % b;
        a = t;
    }
    a
}

fn bfs(start: usize, graph: &HashMap<usize, Vec<usize>>, components: &mut Vec<i32>, component_id: i32) {
    let mut queue = VecDeque::new();
    queue.push_back(start);
    components[start] = component_id;

    while let Some(node) = queue.pop_front() {
        if let Some(neighbors) = graph.get(&node) {
            for &neighbor in neighbors {
                if components[neighbor] == 0 {
                    components[neighbor] = component_id;
                    queue.push_back(neighbor);
                }
            }
        }
    }
}
